    {ntt"total": 12,ntt"recent": 0nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2015-05-06T22:24:00.983411",nt"name": "switchable-shape-memory-alloys-sma-thermal-materials-project",nt"isopen":
    true,nt"url": null,nt"notes": "&lt;p&gt;Shape memory alloys applies to
    a group of materials that demonstrate the ability to return to some previously defined
    shape when subjected to the appropriate thermal procedure. Generally, these materials
    can be plastically deformed at some relative lower temperature, and then upon exposure
    to some higher temperature will return to their original shape prior to the deformation.
    Materials that exhibit this property are referred to as one-way shape memory; some
    materials also undergo shape change upon re-cooling, and are referred to as 2-way
    shape memory. &amp;nbsp;&lt;/p&gt;&lt;p&gt;Generally, an alloy undergoes a transformation
    from the austenite phase to the martensitic upon strain below the transformation
    temperature, which is then reversed upon heating, returning to the parent phase.
    The only two alloys that have achieved any level of commercial exploitation are
    the nickel titanium&amp;nbsp;(NiTi) alloys and the copper-base alloys, particularly
    copper-aluminum-nickel (CuAlNi) and copper zinc aluminum (CuZnAl).&amp;nbsp; In
    training and testing of these SMAs there are indications that they are susceptible
    to cycle fatigue depending upon conditions of use. In this project, two different
    novel designs previously developed are being enhanced and evaluated for&amp;nbsp;
    cycle &amp;nbsp;fatigue&amp;nbsp; of the 2-way SMAs effects for use in intelligent
    &amp;nbsp;thermal systems. &amp;nbsp;Knowing the effective, efficient lifetime of
    each system, it will then be possible to design and optimize a system to a specific
    application in the future.&lt;/p&gt;",nt"license_title": "U.S. Government
